import RegisterForm from "../../components/Register/RegisterForm";
import { useState, useEffect } from "react";
import ConfirmationChoice from "../../components/Register/ConfirmationChoice/ConfirmationChoice";
import Confirmation from "../../components/Register/Confirmation/Confirmation";
import AddressForm from "../../components/Register/AddressForm/AddressForm";
import RegisterSuccess from "../../components/Register/RegisterSuccess/RegisterSuccess";
import { useRouter } from "next/router";
import ProducerNotFound from "../../components/Register/ProducerNotFound/ProducerNotFound";

const SignupProducer = () => {
    const [step, setStep] = useState(0)
    const [userValues, setUserValues] = useState(null)
    const [confirmationChoice, setConfirmationChoice] = useState(null);
    const [loading, setLoading] = useState(false);
    const [invalidCode, setInvalid] = useState(false);
    const router = useRouter()


    useEffect(() => {
        if (router.query.notFound) {
            setStep(-1);
        }
    }, [router.query])
    const handleUserSubmit = (values) => {
        setUserValues(values)
        setStep(1)
    }

    const handleConfimationChoice = async (choice) => {
        setConfirmationChoice(choice)
        try {
            setLoading(true)
            await sendConfirmation(choice)
            setLoading(false)
            setStep(2)
        } catch (e) {
            setLoading(false)

        }

    }

    const handleConfimation = async (value) => {
        const { email, phone } = userValues;
        setLoading(true)
        try {
            const res = await fetch(`${process.env.API_URL}/api/confirmation/verify`,
                {
                    method: 'POST',
                    body: JSON.stringify(
                        {
                            target: confirmationChoice === 'email' ? email : `+55${phone.replace(/\D/g, '')}`,
                            code: value
                        }),
                    headers: {
                        'Content-Type': 'application/json'
                    }

                })
            setLoading(false);
            if (res.status === 200) {
                setStep(3)
            } else {
                setInvalid(true);
            }

        } catch (e) {

            setLoading(false);

            console.log(e)
        }
    }

    const handleAddressSubmit = async (values) => {
        setLoading(true)
        const addressString = `${values.address}, ${values.number}, ${values.city}, ${values.state}`
        const data = await res.json();
        const { lat, lng } = data.results[0].geometry.location
        if (res.status === 200) {
            await createProducer({
                zipcode: values.zipcode,
                address: `${values.address}, ${values.number}`,
                city: values.city,
                state: values.state,
                country: 'BR',
                ...userValues,
                latitude: lat,
                longitude: lng
            })

            document.cookie = `lead=${true}; path=/`;
            setStep(4)
        } else {
            setInvalid(true);
        }
    }

    const sendConfirmation = async (choice) => {
        const { email, phone } = userValues
        try {
            const res = await fetch(`${process.env.API_URL}/api/confirmation/send-${choice}`,
                {
                    method: 'POST',
                    body: JSON.stringify(
                        choice === 'email' ? {
                            email
                        } : {
                                phone: `+55${phone.replace(/\D/g, '')}`
                            }),
                    headers: {
                        'Content-Type': 'application/json'
                    }
                })
            if (res.status !== 200) {
                throw res;
            }
        } catch (e) {
            throw e
        }
    }
    const createProducer = async (body) => {
        try {
            const res = await fetch(
                `${process.env.API_URL}/api/produtores`,
                {
                    method: 'POST', body: JSON.stringify(body),
                    headers: { 'Content-Type': 'application/json' }
                })
            const data = await res.json();

            if (res.status !== 200) {
                throw res.json();
            }
            return data;
        }
        catch (e) {
            console.error(e)
        }
    }
    switch (step) {
        case -1:
            return <ProducerNotFound onSubmit={() => setStep(0)} />
        case 0:
            return <RegisterForm profile="producer" onSubmit={handleUserSubmit} />
        case 1:
            return <ConfirmationChoice choice={confirmationChoice} profile="producer" values={userValues} onSubmit={handleConfimationChoice} />
        case 2:
            return <Confirmation onSendAgain={() => sendConfirmation(confirmationChoice)} invalid={invalidCode} profile="producer" confirmationChoice={confirmationChoice} onSubmit={handleConfimation} />
        case 3:
            return <AddressForm profile="producer" loading={loading.toString()} values={userValues} onSubmit={handleAddressSubmit} />
        case 4:
            return <RegisterSuccess />
    }




}
export default SignupProducer
